import java.io.*;
import java.util.Base64;
import java.util.zip.GZIPInputStream;
import java.util.zip.ZipEntry;
import java.util.zip.ZipInputStream;

/**
 * Created by Jackson on 19.12.2016.
 */
public class Solution {
    private static final String part1 = "";
    private static final String part2 = "";

    public static void main(String[] args) throws IOException {
        String compressedBase64 = part1;
        compressedBase64 += part2;
        byte[] compressed = Base64.getDecoder().decode(compressedBase64);
        String res = decompress(compressed);
        String ss[] = res.split("\\$");
        try (PrintWriter writer = new PrintWriter("sorting.out")) {
            for (String s : ss) {
                writer.println(s);
            }
        }
    }

    public static String decompress(byte[] bytes) throws IOException {
        GZIPInputStream gis = new GZIPInputStream(new ByteArrayInputStream(bytes));
        BufferedReader bf = new BufferedReader(new InputStreamReader(gis, "UTF-8"));
        String outStr = "";
        String line;
        while ((line = bf.readLine()) != null) {
            outStr += line;
        }
        return outStr;
    }
}
